@media screen and (max-width: 767px) {
  #sidemenu::after { bottom: calc(70px + -100dvh); }
  #sidemenu .menu-item:nth-child(1), #sidemenu .menu-item:nth-child(2) { bottom: calc(160px + -100dvh); }
  #sidemenu .menu-item:nth-child(2) { bottom: calc(106px + -100dvh); }
}

@media (max-width: 1023px) {
  body .nav-lang-switcher { bottom: calc(85px + -100dvh); padding: 0px 15px; transform: translate(3px, 0px); }
}

@media (max-height: 400px) {
  #sidemenu { position: static !important; bottom: unset !important; z-index: 1 !important; }
  #sidemenu > li { margin-bottom: 10px !important; }
  .nav-lang-switcher + #sidemenu::after { display: none; }
  .nav-lang-switcher + #sidemenu .menu-item:nth-child(2) { bottom: unset !important; }
  .nav-lang-switcher { position: static !important; bottom: unset !important; z-index: 1 !important; }
  .nav-lang-switcher + #sidemenu .menu-item:nth-child(1), .nav-lang-switcher + #sidemenu .menu-item:nth-child(2) { position: relative; bottom: unset !important; }
  body.menu-open { overflow: visible !important; }
  .mega-menu { overflow: scroll !important; }
  .top-bar .top-bar-right .nav-wrap.open { height: auto !important; overflow: scroll !important; }
}

@media (max-width: 639px) {
  .off body #onetrust-banner-sdk { top: 85%; }
  body #onetrust-banner-sdk h2#onetrust-policy-title { font-size: 16px; }
  body #onetrust-banner-sdk #onetrust-policy-text { font-size: 14px; line-height: 1.25; }
}

@media (min-width: 1024px) {
  .home header:not(.is-stuck) .top-bar .top-bar-right > a { color: rgb(255, 253, 248) !important; }
  .home header:not(.is-stuck) #sidemenu.menu .menu-item a { color: rgb(255, 253, 248); border-radius: 8px; }
}

@media (hover: none) {
  .modal-window__content, .modal-window { display: none !important; opacity: 0 !important; pointer-events: none !important; }
  [inert] { interactivity: auto !important; }
  body .off-canvas-wrapper { filter: none !important; }
}
